import React from "react";
import { Route, Navigate } from "react-router-dom";

export const BlockRouteUser = ({ component: Component, ...props }) => {
  return (
    <Route>
      {!props.loggedIn ? <Component {...props} /> : <Navigate to="/movies" />}
    </Route>
  );
};

export default BlockRouteUser;
